닥터 스트레인지 개봉하면 아주 늦은 시간에 보러가야지
우리 동네에 영화 끝나면 극장 안에서 비명을 지르며 뛰어다니는 아이들이 있어서;;
언제 마주치게 될지 몰라 무섭ㅠ

@Mio_Mine_Mio @tsi09710_lim 닥터 스트레인지 텍스트 없는 버전 포스터.
용량때문에 2000~2500픽셀로 줄인파일입니다.
이미지주소 복사후 :orig 붙여서 저장하시면 됩니다:) 캐릭터포스터 중 다른 배우꺼 필요하시면 말씀해주세요 pic.twitter.com/EHCLSSiqW9

닥터 스트레인지  혹은 스타트렉.
공구 장르 역시 선택해주세요.

) 배우 이름으로 투표하신 분들은 안 하셔도 됩니다.
